import './assets/FormularioRegistrarEquipo.css'
import axios from "../components/api/conexionApi";
import { useEffect, useState } from 'react';
import './assets/Titulo.css'
import validate from './utils/Validaciones';
//import  './assets/registroParticipantes.css'
const EquipoFormulario = () => {
  //para equipo---------------------------------------------------------------------------------
  const [equipoData, setEquipoData] = useState({
    nombreEquipo: '',
    descripcionEquipo: '',
    idEntrenador: '',
  });

  //handle equipo
  const handleEquipoChange = (e) => {
    const { name, value } = e.target;
    setEquipoData((prevData) => ({ ...prevData, [name]: value }));
    
  };
//submit equipo 
const handleSubmitEquipo = async (e) => {
  e.preventDefault();

  try {
    
      // Guardar entrenador
      const responseEntrenador = await axios.post('./storeEntrenador', entrenadorData);
      //setEntrenadorGuardado(responseEntrenador.data);
    con
      // Guardar equipo
      const responseEquipo = await axios.post('./storeEquipo', equipoData);
      //setEquipoGuardado(responseEquipo.data);
    

    // Resto del código si es necesario después de guardar el equipo y el entrenador

  } catch (error) {
    console.error('Error al guardar entrenador o equipo', error);
    
  }
};
 

//para entrenador ---------------------------------------------------------------------------------
  const [entrenadorData, setEntrenadorData] = useState({
    nombreEntrenador: '',
    apellidoEntrenador: '',
    correoEntrenador: '',
  });
  const handleEntrenadorChange = (e) => {
    const { name, value } = e.target;
    setEntrenadorData((prevData) => ({ ...prevData, [name]: value }));
  };

  return (
    <div className= 'contenedor-form '>
    <form onSubmit={handleSubmitEquipo}>
      <h1 className='titulo-1'>Registra un equipo al evento</h1>
      <br/>
      <p>Los campos que finalizan con un asterisco ( <span class="rojo"> * </span>) son obligatorios</p>
      <label className='obligatorio' htmlFor="nombreEquipo">
        Nombre del Equipo:
        </label>
        <input
          name="nombreEquipo"
          value={equipoData.nombreEquipo}
          onChange={handleEquipoChange}
        />
     
      <br />
      <label>
        Descripción del Equipo:
        </label>
        <input
          name="descripcionEquipo"
          value={equipoData.descripcionEquipo}
          onChange={handleEquipoChange}
        />
      
      <br />
      <p>Ingresar los datos del representante o entrenador del equipo</p>
      <label className='obligatorio' htmlFor="idEntrenador">
        CI:  
        </label>
        <input
          
          name="idEntrenador"
          value={equipoData.idEntrenador}
          onChange={handleEquipoChange}
        />
      
      <br />
      
      <label className='obligatorio' htmlFor="nombreEntrenador">
        Nombre:
        </label>
        <input
          
          name="nombreEntrenador"
          value={entrenadorData.nombreEntrenador}
          onChange={handleEntrenadorChange}
        />
      
      <br />
      <label className='obligatorio' htmlFor="apellidoEntrenador">
        Apellido:
        </label>
        <input
          
          name="apellidoEntrenador"
          value={entrenadorData.apellidoEntrenador}
          onChange={handleEntrenadorChange}
        />
      
      <br />
      <label className='obligatorio' htmlFor="corrreoEntrenador">
        Correo:
        </label>
        <input
          
          name="correoEntrenador"
          value={entrenadorData.correoEntrenador}
          onChange={handleEntrenadorChange}
        />
      
      <br/>
      <br/>
      <div className='button-container'>
      <button className='blue-button '>Salir</button>
   
      <button className='blue-button ' type="submit">Crear Equipo</button>

      </div>
     
      
    </form>
    </div>
  );
};
export default EquipoFormulario;
